  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset represents multiple products
  archived at the multiple archive centers for the MODIS (Moderate Resolution Imaging
  Spectroradiometer) instrument aboard the Aqua Satellite. This dataset is provided
  by NASA EOSDIS as a single point of entry for this suite of products. The provided
  access URL is link to EOSDIS's Earthdata Search tool with a pre-populated query
  that will bring up all products archived by EOSDIS with imagery provided by the
